import { MY_ORDER } from '../Actions/types';

const initialState = {
  orderdata: [],
};

export const userOrder = (state = initialState, { type, payload }) => {
  switch (type) {
    case MY_ORDER:
      return { ...state, orderdata: payload };

    default:
      return state;
  }
};
